import React from 'react';

const ImageChangeOnMouseOver = () => {
    return (
        <div>
            <img src="/public/assets/img/img1.jpg" alt=""/>
            <img src="/public/assets/img/img2.jpg" alt=""/>
        </div>
    );
};

export default ImageChangeOnMouseOver;
